import React , { Component } from 'react';

const About = () => {

    return(
        <div>
        <p>Renouick is a way to connect customers who are not capable of finding services and workers who are not capable of promoting their services.</p>
        <p>In the current society people face problems in finding workers for their day to day problems.</p> 
        <p>Even if many workers are available if they cannot be founded when needed there is no use.</p> 
        <p>That is why we provided a solution by introducing Renouick.</p>
        </div>
    );
};

export default About;
